import React from "react";
import { useState } from "react";
import axios from "axios";
import AmazingNumberButton from "./AmazingNumberButton";
import BeautifulScreen from "./BeautifulScreen";
import GreatOperationButton from "./GreatOperationButton";
import MagnificientEqualButton from "./MagnificientEqualButton";
import ItsOverNineThousand from "./ItsOverNineThousand";

function Calculator() {
	const [calc, setCalc] = useState("");

	return (
		<div className="Calculator">
			{setCalc(eval(calc)) > 9000 && (
				<ItsOverNineThousand title="It is over nine hundred" />
			)}
			<BeautifulScreen calc={calc} setCalc={setCalc} />
			<AmazingNumberButton calc={calc} setCalc={setCalc} />
			<GreatOperationButton calc={calc} setCalc={setCalc} />
			<MagnificientEqualButton calc={calc} setCalc={setCalc} />
		</div>
	);
}

export default Calculator;
